import './App.css';

function App() {
	return (
		<div className="top-cont">
			<header>
				<a class="home-button">
					WebShop
				</a>

				<nav>
                 <ul class="top_menu" id="nav">
                    <li>
                        <a class="need-help-button" href="need_help.html" target="_self">Need help?</a>
                    </li>
                </ul>
            </nav>

			</header>


		</div>
	);
}

export default App;
